    return(
        <div className="creditsdiv">
        <p style={{fontSize:'10px'}}>© 2021 | ყველა უფლება დაცულია</p>
        <p style={{fontSize:'22px'}}>სტატისტიკის ეროვნული სამსახური</p>
        
      </div>
    )
}
export default Credits
